function getCep(e,a){var t={pac:a.pac,sedex:a.sedex};$.ajax({url:"/calcula-frete",type:"POST",dataType:"json",data:{cep:e},success:function(e){document.getElementById(t.pac).innerHTML='<input type="radio" name="tipoFrete" value="pac" data-valor="'+e.pac.valor+'" required> PAC - R$'+e.pac.valor+" - at\xe9 "+e.pac.prazo_entrega+" dias \xfateis",document.getElementById(t.sedex).innerHTML='<input type="radio" name="tipoFrete" value="sedex" data-valor="'+e.sedex.valor+'" required> Sedex - R$'+e.sedex.valor+" - at\xe9 "+e.sedex.prazo_entrega+" dias \xfateis"}})}